import React, { useEffect, useState } from 'react';
import { Box, Typography, Paper, Alert } from '@mui/material';
import { Grid } from '@mui/material';
// import AnalyticsPanel from '../components/AnalyticsPanel';
import DeviceMap from '../components/DeviceMap';
import { getSocket } from '../socket';
import { useAuth } from '../auth/AuthContext';

const Home = () => {
  const { role } = useAuth();
  const [deviceData, setDeviceData] = useState('');
  const [deviceId, setDeviceId] = useState('');
  const [deviceStatus, setDeviceStatus] = useState('offline');
  const [error, setError] = useState('');

  useEffect(() => {
    const socket = getSocket();
    socket.on('device-data', (data) => {
      if (data.type === 'heartbeat') {
        setDeviceStatus('online');
        setDeviceData(`Heartbeat Device ID: ${data.deviceId}`);
        setDeviceId(data.deviceId);
      } else {
        setDeviceData(data.payload || JSON.stringify(data));
      }
    });
    socket.on('device-error', (err) => setError(err));
    socket.on('device-status', (data) => {
      if (data && typeof data.online === 'boolean') {
        setDeviceStatus(data.online ? 'online' : 'offline');
      }
      if (data && data.deviceId) {
        setDeviceId(data.deviceId);
        setDeviceData(data.message || '');
      }
    });
    return () => {
      socket.off('device-data');
      socket.off('device-error');
      socket.off('device-status');
    };
  }, []);

  return (
  <Box p={3} sx={{ background: '#181c28', minHeight: '100vh', borderRadius: 3 }}>
    {/* Namebar at the top - single heading only */}
    <Box sx={{ mb: 1.5, p: 2, background: '#23273a', border: '2px solid #00bcd4', borderRadius: 2, boxShadow: '0 2px 12px #00bcd4aa', display: 'flex', alignItems: 'center', justifyContent: 'flex-start' }}>
      <Typography variant="h4" sx={{ letterSpacing: 2, color: '#00eaff', fontWeight: 700 }}>
        Home
      </Typography>
    </Box>

    {/* Device Map Section */}
    <DeviceMap />

    <Grid container spacing={3}>
      <Grid item xs={12} md={6}>
        <Paper
          elevation={12}
          sx={{
            p: 2,
            mb: 2,
            borderRadius: '20px',
            background: '#23273a !important',
            color: '#e3e6f3 !important',
            border: '4px solid #00bcd4',
            boxShadow: '0 8px 32px 0 #00bcd4',
            minHeight: 120,
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'center',
            alignItems: 'flex-start',
            zIndex: 10,
          }}
        >
          <Typography variant="subtitle2" sx={{ color: '#00bcd4', fontWeight: 700, letterSpacing: 1 }}>
            Device Status:
          </Typography>
          <Typography variant="body2" sx={{ fontWeight: 700, fontSize: '1.2rem', color: deviceStatus === 'online' ? '#00ff00' : '#ff1744', mt: 1 }}>
            {deviceStatus.charAt(0).toUpperCase() + deviceStatus.slice(1)}
          </Typography>
        </Paper>
      </Grid>
      <Grid item xs={12} md={6}>
        <Paper
          elevation={12}
          sx={{
            p: 2,
            mb: 2,
            borderRadius: '20px',
            background: '#23273a !important',
            color: '#e3e6f3 !important',
            border: '4px solid #7c4dff',
            boxShadow: '0 8px 32px 0 #7c4dff',
            minHeight: 120,
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'center',
            alignItems: 'flex-start',
            zIndex: 10,
            transition: 'transform 0.2s, box-shadow 0.2s',
            '&:hover': {
              transform: 'scale(1.03)',
              boxShadow: '0 12px 40px 0 #7c4dffcc',
            },
          }}
        >
          <Typography variant="h6" sx={{ color: '#7c4dff', fontWeight: 800, letterSpacing: 1 }}>
            Live Device Data
          </Typography>
          <Box>
            {deviceData ? (
              <Box>
                <Typography variant="body1" sx={{ fontWeight: 'bold', color: '#00eaff' }}>
                  {deviceData}
                </Typography>
                {deviceId && (
                  <Typography variant="body2" color="text.secondary" sx={{ mt: 1 }}>
                    Last heartbeat: {new Date().toLocaleTimeString()}
                  </Typography>
                )}
              </Box>
            ) : (
              <Typography variant="body1" sx={{ color: '#ff1744' }}>
                No device data yet. Waiting for heartbeat packets...
              </Typography>
            )}
          </Box>
        </Paper>
      </Grid>
    </Grid>
    {error && <Alert severity="error">{error}</Alert>}
    <Typography variant="body2" sx={{ mt: 2, color: 'secondary.light', fontWeight: 700 }}>
      Role: {role}
    </Typography>
  </Box>
  );
};

export default Home;
